window.bookSummaryJSON = "<p>Once upon a time I met four monsters and thought the world would come to an end at their hands. </p> <p>But I was a fool. <br> Because I didn’t understand the bigger picture. <br> That the enemies I thought I knew would become the reason for my entire existence. My strength. My pain. My life. My love. </p> <p>The big bad wolf has teeth and claws as sharp as iron, and the danger before my eyes is blinding. So blinding that I didn’t see the true danger lurking in the dark. </p> <p>But now my eyes are wide open and I see it all. </p> <p>Alone and afraid and running out of time, I’m not afraid of monsters anymore. </p> <p>I’m counting on them to come for me. </p> <p>Because if they don’t, this foolish girl might be lost forever in the dark.</p>"; 
